import React, {useState} from 'react';
import TaskItem from './TaskItem.js';
import '../index.css';

const TaskList = (props) => {

    const taskCheckedHandler = (event) => {
        props.onTaskChecked(event);
    }

    if(props.tasks){
        if (props.tasks.length > 0){
            let key = 0;
            var taskContent = props.tasks.map((data) =>
            <TaskItem onTaskChecked={taskCheckedHandler} key={key += 1} taskTitle = {data.taskTitle} taskDetails = {data.taskDetails}></TaskItem>)
        }
    }
    return (
        {taskContent}
    );
}

export default TaskList;
